// src/app/pages/result/result.component.ts
import { Component, OnInit } from '@angular/core';
import { ActivatedRoute, Router } from '@angular/router';
import { DataService, Specialization, Skill } from '../../services/data.service';

@Component({
  selector: 'app-result',
  templateUrl: './result.component.html',
  styleUrls: ['./result.component.scss']
})
export class ResultComponent implements OnInit {
  specialization?: Specialization;
  userSkillIds: number[] = [];
  matchPercentage: number = 0;
  recommendedCourses: string[] = [];
  ownedSkillNames: string[] = [];

  constructor(
    private route: ActivatedRoute,
    private router: Router,
    private dataService: DataService
  ) {}

  ngOnInit() {
    const id = Number(this.route.snapshot.paramMap.get('id'));
    const state = history.state || {};
    this.userSkillIds = state.userSkillIds || [];

    this.dataService.getSpecializationById(id).subscribe(spec => {
      this.specialization = spec;
      if (!spec) {
        // ŸÑŸà ŸÖÿß ŸÅŸäŸá ÿ™ÿÆÿµÿµ ‚Äì ŸÜÿ±ÿ¨ÿπ ŸÑŸÑÿ™ÿÆÿµÿµÿßÿ™
        this.router.navigate(['/specializations']);
        return;
      }
      this.calculateMatch(spec);
      this.generateRecommendations(spec);
    });
  }

  calculateMatch(spec: Specialization) {
    const total = spec.requirements.length;
    const matchedCount = spec.requirements.filter(req =>
      this.userSkillIds.includes(req.id)
    ).length;
    this.matchPercentage = total ? Math.round((matchedCount / total) * 100) : 0;

    // ÿ£ÿ≥ŸÖÿßÿ° ÿßŸÑŸÖŸáÿßÿ±ÿßÿ™ ÿßŸÑŸÑŸä ŸäŸÖÿ™ŸÑŸÉŸáÿß ÿßŸÑŸÖÿ≥ÿ™ÿÆÿØŸÖ ŸÑŸÑÿπÿ±ÿ∂
    this.ownedSkillNames = spec.requirements
      .filter(r => this.userSkillIds.includes(r.id))
      .map(r => r.name);
  }

  generateRecommendations(spec: Specialization) {
    const missing = spec.requirements.filter(req => !this.userSkillIds.includes(req.id));
    this.recommendedCourses = missing.map(m => `ÿØŸàÿ±ÿ© ŸÑÿ™ÿπŸÑŸÖ ${m.name}`);
  }

  goBack() {
    this.router.navigate(['/specializations']);
  }
}
<div class="result-container" *ngIf="specialization">
  <h2>ŸÜÿ™Ÿäÿ¨ÿ™ŸÉ ŸÅŸä ÿ™ÿÆÿµÿµ: {{ specialization?.title }}</h2>

  <div class="match-section">
    <h3>ŸÜÿ≥ÿ®ÿ© ÿßŸÑÿ™ŸàÿßŸÅŸÇ</h3>
    <div class="match-circle">
      {{ matchPercentage }}%
    </div>
  </div>

  <div class="skills-section">
    <h3>ÿßŸÑŸÖŸáÿßÿ±ÿßÿ™ ÿßŸÑÿ™Ÿä ÿ™ŸÖÿ™ŸÑŸÉŸáÿß</h3>
    <ul>
      <li *ngFor="let skill of userSkillId">{{ skill }}</li>
    </ul>

    <h3>ÿßŸÑŸÖŸáÿßÿ±ÿßÿ™ ÿßŸÑŸÖŸÇÿ™ÿ±ÿ≠ÿ© ŸÑŸÑÿ™ÿ∑ŸàŸäÿ±</h3>
    <ul>
      <li *ngFor="let course of recommendedCourses">{{ course }}</li>
    </ul>
  </div>

  <button (click)="goBack()" class="back-btn">üîô ÿπŸàÿØÿ© ŸÑŸÑÿ™ÿÆÿµÿµÿßÿ™</button>
</div>
